happy to share that The New Antiquarians is out today! 

I had the pleasure of photographing this incredible book by @michaeldiazgriffith , published by @monacellipress (with UK photography by @leonfoggitt ). The book features 22 brilliant young collectors from across the United States and Britain who brazenly blend the old with the new, embrace anachronism and pastiche, employ serious knowledge with humor and wit, and consider vintage and historical objects through the lens of contemporary values.

It was an incredible creative and personal experience to work on this book alongside Michael, and to meet and photograph the homes and collections of these brilliant, thoughtful, and witty collectors. I’ll be sharing lots of photos from the project over the coming weeks, so stay tuned. 

In the meantime, tap the link in my bio to purchase the book. 

